import React from 'react';

function DealerService(){
    return(
        <div className='contaier-fluid d-flex flex-column justify-content-center align-items-center'>
            <div className='row'>
                <div className='col d-flex flex-column justify-content-center align-items-center text-center'>
                    <img className='rounded w-100 px-4 mb-4' src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQxeazsDe_xhyFQsJCX5yjou-bT04EhgMdjIg&usqp=CAU'></img>
                </div>
            </div>
        </div>
    );
}

export default DealerService;
